// IncorrectQuestionsScreen.js

import React from 'react';
import { StyleSheet, View } from 'react-native';
import Button from '../components/Button';
import Background from '../components/Background';
import Quiz from '../components/Quiz';
import data from '../helpers/data'; // Assuming you have a data file with the questions

export default function IncorrectQuestionsScreen({ navigation, route }) {
    const { incorrectIndices } = route.params;

    return (
        <Background>
            <View style={styles.container}>
                <Quiz data={data} incorrectIndices={incorrectIndices} navigation={navigation} />

            </View>
        </Background>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
    },
});
